eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"speakers\": () => (/* binding */ speakers)\n/* harmony export */ });\nconst speakers = [\n    // {\n    //     name: 'Harold (Hal) Abelson',\n    //     affiliation: 'Professor, MIT (Electrical Engineering and Computer Science) & IEEE Fellow',\n    //     img: 'abelson.jpeg',\n    //     bio: 'Harold (Hal) Abelson is Class of 1922 Professor of Electrical Engineering and Computer Science at MIT and a Fellow of the IEEE. He holds an A.B. degree from Princeton University and a Ph.D. degree in mathematics from MIT. In 1992, Abelson was designated as one of MIT\\'s six inaugural MacVicar Faculty Fellows, in recognition of his significant and sustained contributions to teaching and undergraduate education. Abelson was recipient in 1992 of the Bose Award (MIT\\'s School of Engineering teaching award), winner of the 1995 Taylor L. Booth Education Award given by IEEE Computer Society, cited for his continued contributions to the pedagogy and teaching of introductory computer science, and of the 2012 ACM Special Interest Group on Computer Science Education Award for Outstanding Contribution to Computer Science Education, and winner of the 2011 ACM Karl Karlstrom Outstanding Educator Award. Abelson has played key roles in fostering MIT institutional educational technology initiatives including MIT OpenCourseWare and DSpace, and he has served as co-chair of the MIT Council on Educational Technology, which oversees MIT\\'s strategic educational technology activities and investments. He is a leader in the worldwide movement towards openness and democratization of culture and intellectual resources. He was a founding director of Creative Commons, Public Knowledge, and the Free Software Foundation, and a director of the Center for Democracy and Technology — organizations that are devoted to strengthening the global intellectual commons. Abelson been active since the 1970\\'s in using computation as a conceptual framework in teaching. He directed the first implementation of children\\'s computer language Logo for the Apple Computer, which made the language widely available on personal computers beginning in 1981; and he published a widely selling book on Logo in 1982. His book Turtle Geometry, written with Andy diSessa in 1981, presented a computational approach to geometry was cited as \\'the first step in a revolutionary change in the entire teaching/learning process.\\' Abelson leads the development of MIT App Inventor. App Inventor, started by Abelson when he was a visiting faculty member at Google Research, is a Web-based development system aimed at making it easy for young students -- or anyone -- to create original mobile applications. Abelson is codirector of the MIT Internet Policy Research Initiative, which collaborates with policymakers and technologists to improve the trustworthiness and effectiveness of interconnected digital systems like the Internet. More generally, Abelson has a broad interest in information technology and policy, and he developed and teaches The MIT course Foundations of Information Policy. He co-authored the 2008 book Blown to Bits, which describes, in non-technical terms, the cultural and political disruptions caused by the information explosion. Together with MIT colleague Gerald Sussman, Abelson developed the computer science subject, Structure and Interpretation of Computer Programs, which is organized around the notion that a computer language is primarily a formal medium for expressing ideas about methodology, rather than just a way to get a computer to perform operations. This work, through a popular computer science textbook by Abelson and Gerald and Julie Sussman, videos of their lectures, and the availability on personal computers of the Scheme dialect of Lisp (used in teaching the course), has had a world-wide impact on university computer-science education. This work served as MIT\\'s own introductory computer science subject from 1980 until 2007.',\n    //     title: 'MIT App Inventor, From Computational Thinking to Computational Action',\n    //     abstact: 'Starting from its roots in the late 1960s, exposing young people to the ideas of computational thinking has emerged as an important theme in preparing them for effective citizenship in the information society. Beyond just exposure to ideas, we’re now seeing how students as young as primary school can use those ideas to improve life at the personal level, the community level, even the national level. This empowerment through computational action results from the past decade’s developments in mobile computing, cloud services, Internet of things, and machine learning, bringing the world’s most powerful computing tools within the grasp of even beginning learners. In this talk I\\'ll survey the work of the MIT App Inventor CSAIL research project.  Our work empowers anyone to create original mobile apps, with a platform that hosts a million people a month.',\n    // },\n    // {\n    //     name: 'Dan Huttenlocher',\n    //     img: 'huttenlocher.jpeg',\n    //     affiliation: 'Inaugural Dean, MIT Schwarzman College of Computing',\n    //     bio: 'Daniel Huttenlocher is the inaugural dean of the MIT Schwarzman College of Computing. Previously he helped found Cornell Tech, the digital technology oriented graduate school created by Cornell University in New York City, and served as its first Dean and Vice Provost. His research and teaching have been recognized by a number of awards including ACM Fellow and CASE Professor of the Year. Huttenlocher\\'s main research interests are in computer vision, social media, and understanding AI. He has a mix of academic and industry background, having been a Computer Science faculty member at Cornell, researcher and manager at the Xerox Palo Alto Research Center (PARC), and CTO of a fintech startup. He served as a member and as the chair of the board of the John D. and Catherine T. MacArthur Foundation, and currently serves as a member of the boards of Corning Inc. and Amazon.com. He received his bachelor\\'s degree from the University of Michigan, and master\\'s and doctorate from MIT.',\n    // },\n    // {\n    //     name: 'Ali Abedi',\n    //     affiliation: 'Professor, University of Maine',\n    //     img: 'ali.jpeg',\n    //     type: 'Keynote',\n    //     title: 'Digital Radio Intelligent Forest Twin (DRIFT)',\n    //     abstact: 'Forest ecosystem plays a major role in determining the future climate. We need to monitor the forest environment to learn how stressors affect the changes over time. The concept of digital twins and parallel intelligence can be a powerful tool to create a digital replica of a forested land in the cloud with real time connections to the physical forest using radio frequency identification tags and sensors. This is an ambitious goal which requires a significant number of sensors which are low cost, reliable and power efficient. We also require extremely efficient spectrum sharing strategies to make this network economical, while not interfering with other existing networks. In this talk, we will take a deeper look at deep learning and artificial intelligence to learn how a digital forest twin can operate using a radio intelligent system. If you are interested to learn about wireless sensing, networking, and AI you will find this talk interesting. The main goal of this research is to predict abrupt or extreme events as well as slow changes in the climate and help develop data driven forest management plans and policies.',\n    //     bio: 'Ali Abedi received his BSEE and MSEE from Sharif University in 1996 and 1998, and his PhD in Electrical and Computer Engineering, from University of Waterloo in 2004. Dr. Abedi joined the University of Maine, Orono in 2005, where he is currently Professor of Electrical and Computer Engineering and Associate Vice President for Research at UMaine, an R1 Classified Institution by Carnegie foundation. He was visiting Associate Professor at the University of Maryland, College Park, MD and Guest Researcher at NIST in 2012 and Faculty Fellow at NASA in 2016. Dr. Abedi is founding Director of WiSe-Net Lab where he directs research programs in wireless communications and sensor networks for structural monitoring, space explorations and bio-medical applications. Dr. Abedi has completed 60+ funded research grants worth over $34M resulting in 115+ publications with over 44,000+ downloads and 1000+ citations. He is the recipient of several IEEE awards and served as Associate Editor from multiple IEEE journals, and chair for several IEEE conferences. He is 2022 Vice President for Conferences at IEEE Council on Radio Frequency Identification.',\n    // },\n    {\n        name: \"Sreeram (Ram) Dhurjaty, PhD, LSMIEEE, AD2BW\",\n        affiliation: \"PhD, Senior Member of the Institute of Electrical and Electronics Engineers (SMIEEE)\",\n        img: \"sreeram.jpeg\",\n        type: \"Keynote\",\n        title: \"Analogies and their power in creativity\",\n        abstact: \"Analogies are powerful tools. some Nobel-prizes have been won by scientists who started with Analogies. Maxwell developed his equations in electromagnetics by using analogs  to fluid flow. In this talk, as an example, I will illustrate the power of analogies between millions of people running, back and forth in circles and the development of MR imaging. Various aspects of MRI will be related to this simple analogy. The genesis of this analogy came from Sir Peter Mansfield, who later won the Nobel, for the creation of the first live image of a human body part using MRI. The key to using analogies is by strating with a simple model and thenexpanding it as necessary.\",\n        bio: \"Ram held senior positions in engineering and research, in medical systems, at Eastman Kodak Company, Analogic, and Bose Corporation before embarking on a career of full time consulting. He was educated at IIT Bombay and Yale University and has degrees in Civil Engineering, Fluid mechanics, Electronic Instrumentation, Biomedical Engineering, and Control System Theory. Over his career he has designed medical systems such as Patient Monitors, Defibrillators, CT scanners, Fetal Monitoring systems, Digital and Computed Radiography, and Telemedicine. He has written standards for ECG systems and Defibrillators for AAMI. He was the past chair of the IEEE, Rochester NY section. Ram has consulted for Universities as well as Industry, including some fortune 100 companies. His consulting includes Strategic-Technology Consulting, Designing and implementing research systems for Universities, System design and implementation for the Medical device industry. His consulting includes precision Analog circuitry, High Voltage Power supplies and Magnetics for X-Ray systems. He has 16 issued patents in areas of medical devices and systems. His significant Inventions include a Hand-Cranked defibrillator and the retrofittable Digital Radiography system. Ram is a mentor to several startups in the Rochester, NY area and is also involved in STEM science fairs. He likes working with young people. Ram is a Life senior member of the IEEE, Emeritus member of AAPM, member of AHA and member of SPIE.\"\n    },\n    {\n        name: \"Bryan Knouse\",\n        affiliation: \"Co-Founder and CEO of OWL Integrations\",\n        img: \"knouse.jpg\",\n        type: \"Keynote\",\n        title: \"\\u201CDucks\\u201D taking flight and the next Space Race\",\n        abstact: \"\",\n        bio: \"Bryan is a\\xa0Co-Founder and CEO of OWL Integrations.\\xa0 Bryan has led OWL to international grand prize awards in the IBM Call for Code and US Army's TechSearch competitions, and currently leads OWL's efforts across several US Air Force research and development contracts.\\xa0Bryan has a B.S. in Mechanical Engineering from the University of Rochester. Bryan is passionate about technology, innovation,\\xa0private-academic partnerships, and the ongoing shift to American\\xa0semiconductor manufacturing.\"\n    },\n    {\n        name: \"Sarah Maston\",\n        affiliation: \"Director of Partner Development and Strategy at Microsoft\",\n        img: \"maston.png\",\n        type: \"Keynote\",\n        title: \"The Fifth Industrial Revolution (5IR) - A New Era for Sustainability and Conservation\",\n        abstact: \"The Fifth Industrial Revolution (5IR) is leveraging technologies of the Forth Industrial Revolution (4IR) and offering the opportunity to create wide-reaching environmental benefits, social benefits, and justice benefits through the application of data, the connectivity of devices through the IoT, artificial intelligence and machine learning. The private sector is active across the deployment of 4IR technologies in the global North, closing the digital divide with countries in the global South is our opportunity to support a wide range of environmental benefits delivered through systems improvements with more equitable access to economic opportunities, socio-economic benefits, and job creation. Join Sarah Maston, Principal Solution Architect & Founder of Project 15 from Microsoft as she explores how partnership across the public and private sectors will bring the innovation needed to create scalable solutions and systems of change in both the Global North and the Global South empowering communities and scaling impact across the  SDG targets set by the United Nations.\",\n        bio: 'Sarah Maston is a director of partner development and strategy at Microsoft. She is the founder of Project 15 from Microsoft, (aka.ms/project15story), and co-inventor of the Project 15 Open Platform (aka.ms/project15code) developed in partnership with the GEF Small Grants Programme implemented by the United Nations Development Programme. In her 20+ year career, she has architected many global data intelligence platforms and is the recipient of the Microsoft Gold Club Award in 2023 for her invention of the \"Mainframe Data Pipe for Azure\" in partnership with Kyndryl. Prior to joining Microsoft, she won an Outstanding Innovation Award from IBM for the invention of Simple Data Pipe and received an Excellence & Eminence Award for the invention of the Nutrition Graph as a winner of IBM\\u2019s Blue Unicorn Innovation Contest.'\n    },\n    {\n        name: \"Mark Maybury, PhD\",\n        affiliation: \"Vice President, Commercialization, Engineering, and Technology for Lockheed Martin\",\n        img: \"maybury.png\",\n        type: \"Keynote\",\n        title: \"Changing the World through Applied Research\",\n        abstact: \"\",\n        bio: \"Dr. Mark Maybury is vice president, Commercialization, Engineering & Technology for Lockheed Martin Corporation. In this capacity, he is responsible for leading efforts to monetize product research and development (R&D) efforts for long-term growth in commercial and defense sectors. He works with the Corporate Technology Office, 5G.MIL \\xae team, LM Ventures and the business areas to identify innovative methods to bring our capabilities to new markets, determine what existing R&D efforts have commercial value and partner with the recently launched LMEvolve team to explore new business models. \\n Previously, Dr. Maybury was the first Chief Technology Officer for Stanley Black & Decker,where he provided strategic technology and commercialization guidance to the CEO for the $17B global enterprise. His 36 years of experience spans both private and public sectors in innovation commercialization, ventures investment, cybersecurity, artificial intelligence and machine learning (AI/ML), data analytics, C3I, energy storage, advanced manufacturing, competitive intelligence, revenue and margin growth, and global supply chains. \\nDr. Maybury's board experience extends over the past 17 years. He currently serves on the Board and Chairs the Nomination Committee at Internet Sciences Inc. and is a Board Advisor to READY Robotics, Flora Surfaces, and Halo Energy. He is a Special Government Employee co-chairing the Congressionally Directed Task Force on Digital Engineering for the Defense Science Board. He served previously on multiple boards including the Executive Committee of the Air Force Scientific Advisory Board, the Homeland Security Science and Technology Advisory Committee, the Connecticut Science Center, and Mark Twain House and Museum. \\nAs a U.S. Air Force officer, Mark was awarded the Air Force Commendation Medal. He subsequently served for 27 years at The MITRE Corporation in leadership roles including Chief Technology Officer, Chief Security Officer, and Director of the NIST Cybersecurity FFRDC. He was the 33rd Chief Scientist of the USAF advising the Secretary of the Air Force and Chief of Staff of the Air Force on S&T and national security. \\nDr. Maybury received his BA in mathematics from College of the Holy Cross (Fenwick Scholar, valedictorian), a MPhil in computer speech and language processing from Cambridge University, England (Rotary Scholar), a MBA from Rensselaer Polytechnic Institute, and a PhD in artificial intelligence from University of Cambridge, U.K. Dr. Maybury is a Fellow of both the IEEE and the Association for the Advancement of Artificial Intelligence. He has authored or edited 10 books and more than 60 refereed publications. A key contributor to 30 national studies, he has led 8. He has testified to the U.S. Congress, served as expert witness in the U.K., and been awarded 6 patents and numerous awards including from the Secretary of Defense and President of the United States.\"\n    },\n    // {\n    //     name: 'Edward Adelson',\n    //     affiliation: 'John and Dorothy Professor of Vision Science, MIT (Brain and Cognitive Sciences)',\n    //     img: 'adelson.jpeg',\n    //     bio: 'Edward Adelson is the John and Dorothy Professor of Vision Science at MIT, in the Department of Brain and Cognitive Sciences, and the Computer Science and Artificial Intelligence Laboratory (CSAIL). For much of his career he has worked on human vision and computer vision, on topics such as multiscale image representation, motion perception, material perception, and plenoptic imaging. In recent years he has been working on artificial tactile sensing, using an optically based touch system known as GelSight, exploring how high resolution touch can advance robotic manipulation. Professor Adelson is a member of the National Academy of Sciences, a Life Fellow of the IEEE, and the recipient of the Nakayama Medal in Vision Science.',\n    //     title: 'Giving Robots a Sense of Touch',\n    //     abstact: 'Machines are beginning to catch up with humans in many ways, for example in vision, speech, autonomous driving, and robot locomotion. But humans still put robots to shame when using their hands for everyday tasks. Why are robots so bad at manipulation? After all, robot hands are built with precision parts, while human hands are built from squishy flesh. The trick is that human hands are covered with tactile sensors and filled with proprioceptive sensors, and sensory data is needed for controlling interactions with the world. My lab builds robot fingers that are soft like human fingers and which have higher resolution touch sensing than human fingers. Our goal is to give robots a sense of touch, and to use tactile information to guide skillful manipulation. A robot equipped with our fingers can fold a towel or tell if an avocado is ripe.',\n    // },\n    {\n        name: \"Andrew Sass, PhD\",\n        affiliation: \"Vice Chair of the Long Island Robotics and Automation Chapter, IEEE\",\n        img: \"sass.jpg\",\n        type: \"Speaker\",\n        title: \"ESP32 Robotics System Workshop\",\n        abstact: \"The proliferation of the ESP32 series of System-On-Chip (SOC) microcontrollers with Wi-Fi capability, makes possible the development of unique Robotics Systems allowing both operator and autonomous operation. Two Wi-Fi systems will be introduce at the workshop. Both systems have been built and incorporated in a prototype mobile robot.\",\n        bio: \"Dr. Sass holds a BSEE from the Massachusetts Institute of Technology and an MSEE and Ph.D.(EE) from Purdue University. He was a 2 nd Lt. in the US Army assigned to NASA working in the field of Superconducting Magnets. As a research engineer at RCA Research Labs in Princeton, NJ, he developed new superconducting memory elements and subsystems. He is the author and co-author of a number of reviewed published papers and the lead author of a chapter on computer memories in a book entitled Applied Superconductivity.. He is a recipient of the David Sarnoff Outstanding Achievement Award in Science. As a Senior Engineer at IBM Development Lab in Fishkill, NY he led the team which developed the first high-capacity semiconductor memory chip. As Director of Technology at Motorola\\u2019s Consumer Division in Franklin Park, Illinois, he conceived a multi-game video game Integrated Circuit System. As Director of Product Planning at General instrument's Microelectronics Division in Hicksville, NY, he was responsible for video game and other Integrated Circuit development. After retirement from industry, he taught AP Physics, Physics, and Robotics. He helped form and co-coached a high school FIRST robotics team which won the 2007 L.I. FIRST Robotics Regional and competed in the Atlanta Nationals. Dr. Sass is Vice Chair of the Long Island Robotics and Automation chapter of the IEEE. He has been designing and building robots for more than 20 years.\"\n    },\n    {\n        name: \"Farzane Yahyanejad, PhD\",\n        affiliation: \"Senior Data Scientist at Microsoft\",\n        img: \"yahyanejad.jpg\",\n        type: \"Panelist\",\n        title: \"Women in STEM\",\n        abstact: \"\",\n        bio: \"Farzane is a senior data scientist at Microsoft and has been working on Microsoft Azure cloud services.  Before that, she was working for Humana, a healthcare company, as a senior data scientist. Her responsibilities were to build and maintain predictive models to improve healthcare programs by utilizing machine learning techniques. She graduated from the University of Illinois at Chicago with a PhD in Computer Science in 2019. She also has MSc and BSc degrees in Computer Science.\"\n    },\n    {\n        name: \"Riddhiben Shah\",\n        affiliation: \"Senior Software Engineer at Vicor\",\n        img: \"riddhiben_shah.PNG\",\n        type: \"Panelist\",\n        title: \"Women in STEM\",\n        abstact: \"\",\n        bio: \"Riddhi Shah is a Senior Software Engineer at Vicor, bringing her expertise to the world of technology. Originally from India, she earned her Master of Science in Electrical and Computer Engineering from UMASS Lowell in 2016. Riddhi's passion lies in continually expanding her programming skills and staying at the forefront of AI and ML trends. Her research focus is on driving innovation in semiconductor manufacturing to enhance yield and fault detection processes. As a dedicated advocate for women in STEM, Riddhi actively mentors aspiring female engineers, sharing her experiences and knowledge to inspire the next generation.\"\n    },\n    {\n        name: \"Aline Vargas\",\n        affiliation: \"Engineer at Proctor & Gamble\",\n        img: \"vargas.jpg\",\n        type: \"Panelist\",\n        title: \"Women in STEM\",\n        abstract: \"\",\n        bio: 'Aline Vargas graduated from MIT, class of 2021 course 2A-10B. At MIT she was involved in the Biomaker space, Archery, GEL, the UA Covid 19 Committee, McCormick House Govt, and startups--winning the MIT Water Innovation Prize for SVETEX, a sustainable fabric. Aline is now an engineer at Procter & Gamble where she has worked across multiple brands. Her technical passions lie in product innovation, startups, sustainability, people understanding, and business model innovation. At the heart of everything Aline does is: wanting, willing, and working for the good of others for their own sake. Having grown up in Mexico, where family and community are highly valued, Aline seeks to build up the community wherever she goes. In her free time Aline loves making the best of every day with loved ones & learning a new skill every month--so as to \"become the best version of herself\".'\n    },\n    {\n        name: \"Lujie Yang\",\n        affiliation: \"EECS Graduate Student at MIT\",\n        img: \"lujieyang.jpg\",\n        type: \"Panelist\",\n        title: \"Women in STEM\",\n        abstact: \"Lujie Yang received the B.S. degree in mechanical engineering from the University of California, Berkeley in 2020. She is currently working toward the Ph.D. degree in electrical engineering and computer science at the Massachusetts Institute of Technology. Her research seeks to enable robots to operate robustly and intelligently, with theoretical guarantees, by combining optimization, control theory and machine learning. She was the recipient of the Presidential Graduate Fellowship, Richard C. Dupont Fellowship and Tung/Lewis Fellowship at MIT. She won the best presentation award at MIT LIDS student conference 2023.\",\n        bio: \"\"\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./src/speakers/speaker_info.js\n");

